import React from "react";

export default function Home() {
  return (
    <div style={{
      color: "white",
    }}>
      <h1
        style={{
          color: "white",
        }}
      >
        SWAPI
      </h1>
      <h2>The Star Wars API</h2>
      <p>
        All the Star Wars data you've ever wanted: Planets, Spaceships,
        Vehicles, People, Films and Species From all SEVEN Star Wars films Now
        with The Force Awakens data!
      </p>
    </div>
  );
}
